import React, {Component, Fragment} from 'react'
import Question from './Question'

class Game extends Component{
    render(){
        return(
            <Fragment>
                {this.props.questions.map(q => <Question data={q} evaluate={this.evaluate}/>)}
            </Fragment>
        )
    }
}

export default Game
